import axios from "axios";
import { resolve } from "path";

const REACT_APP_API_KEY:string = "5g8vKlZ1cKxQTSsCcUaGgBRW68vBUZDKMYAhgxOp"
const getPreFectures: any = async () => {
  // 都道府県一覧を取得する
  await axios.get("https://opendata.resas-portal.go.jp/api/v1/prefectures", {
      headers: { "X-API-KEY": REACT_APP_API_KEY },
    })
    .then(async (results) => {
        resolve(results.data);
        // return await results.data;
    })
    .catch(async (error) => {return null});
}
export default getPreFectures;
